import React from 'react';
import './Signup.css';


 const Signup = (props) => { 
    return (
        <div className="signup">
         <div><p className="text"> {props.field}</p></div>
         <input type={props.type} onChange={props.changed} onClick={props.click}/> 
        </div>
       
    );

}
export default Signup;
